import React from 'react';
import strawberry from '../images/strawberry.svg'
const Catalog = () => {
    return (
        <>
        <div className="flex-col ">
        <div className=" bg-pink-cf flex justify-center items-center rounded w-fit">
            <div>
            <h3 className="text-2xl text-red-200">More than Faster </h3><span><img src={strawberry} alt="strawberry "/></span>
            </div>
        </div>
        </div>
        </>
    );
};

export default Catalog;
